Job ID: 22c19434-7a04-4415-8 Customer Ono

Vault CRM has all vcountry__v records, however the migrator tried to upsert those records, but failed to do so. below is the error message

Error Type OPERATION_NOT_ALLOWED Another resource already exists with [name__v=PL];Error Type OPERATION_NOT_ALLOWED Another resource already exists with [alpha_2_code__v=PL];

# alter_modify_catalog_event_attendee__v_em_attendee_type__v.mdl

ALTER Object event_attendee__v(
        MODIFY Field em_attendee_type__v(
                formula('em_attendee__vr.attendee_type__v'),
                enhanced_blank_handling('blanks_as_blanks')
        )
);

# alter_modify_catalog_child_account__v_parent_furigana__v.mdl

ALTER Object child_account__v(
        MODIFY Field parent_furigana__v(
                formula('parent_account__vr.furigana__v'),
                enhanced_blank_handling('blanks_as_zeros_and_empty_strings')
        )
);

During Pacira data loading jon, we had 2,500 out of 2,627,430 address records fail with one of the two error message below. Running a delta solved the issue. Addint to tracker for review. 

Error Type OPERATION_FAILED Batch operation failed.;
Error Type UNEXPECTED_ERROR null;

